import axios from "axios"
export const addProductToCart=async(product,encodedToken)=>{
    try{
        const response=await axios.post("/api/user/cart",{
            headers: { authorization: encodedToken },
            product
        })
        console.log(response);
        
    }
    catch(e){
        console.log(e);
    }
}
